import json
import pandas as pd

# Load the weather data
try:
    weather_data = pd.read_csv('weather_data.csv')
except FileNotFoundError:
    print("The file 'weather_data.csv' was not found.")
    exit()

# Subtask 1: Check if the weather data contains timezone information
# We will check if the 'start_time' and 'end_time' columns contain timezone information
def has_timezone_info(time_str):
    return '+' in time_str or '-' in time_str

# Check a sample of the data to determine if timezone information is present
sample_start_time = weather_data['start_time'].dropna().iloc[0]
sample_end_time = weather_data['end_time'].dropna().iloc[0]

timezone_in_start_time = has_timezone_info(sample_start_time)
timezone_in_end_time = has_timezone_info(sample_end_time)

# Subtask 2: If timezone information is present, extract the timezone
def extract_timezone(time_str):
    if '+' in time_str:
        return time_str.split('+')[1]
    elif '-' in time_str:
        return time_str.split('-')[1]
    else:
        return None

timezone_start = extract_timezone(sample_start_time) if timezone_in_start_time else None
timezone_end = extract_timezone(sample_end_time) if timezone_in_end_time else None

# Determine the final timezone
final_timezone = timezone_start if timezone_start == timezone_end else "Timezones do not match"

# Print the answers
print(json.dumps(
    {
        "subtask-1": {
            "timezone_in_start_time": timezone_in_start_time,
            "timezone_in_end_time": timezone_in_end_time
        },
        "subtask-2": {
            "timezone_start": timezone_start,
            "timezone_end": timezone_end
        },
        "main-task": final_timezone
    },
    indent=4
))
